{"cells":[{"metadata":{"_uuid":"8f2839f25d086af736a60e9eeb907d3b93b6e0e5","_cell_guid":"b1076dfc-b9ad-4769-8c92-a6c4dae69d19","trusted":true},"cell_type":"code","source":"# This Python 3 environment comes with many helpful analytics libraries installed\n# It is defined by the kaggle/python Docker image: https://github.com/kaggle/docker-python\n# For example, here's several helpful packages to load\n\nimport numpy as np # linear algebra\nimport pandas as pd # data processing, CSV file I/O (e.g. pd.read_csv)\n\n# Input data files are available in the read-only \"../input/\" directory\n# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n\nimport os\nfor dirname, _, filenames in os.walk('/kaggle/input'):\n    for filename in filenames:\n        print(os.path.join(dirname, filename))\n\n# You can write up to 5GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session","execution_count":2,"outputs":[{"output_type":"stream","text":"/kaggle/input/shampoo/shampoo.csv\n","name":"stdout"}]},{"metadata":{},"cell_type":"markdown","source":"* The importance and types of trends that may exist in time series and how to identify them.\n* How to use a simple differencing method to remove a trend.\n* How to model a linear trend and remove it from a sales time series dataset.\n\n\n\nA trend is a long-term increase or decrease in the level of the time series.\n\n**Identifying and understanding trend information can aid in improving model performance; below are a few reasons:**\n\n* Faster Modeling: Perhaps the knowledge of a trend or lack of a trend can suggest methods and make model selection and evaluation more efficient.\n* Simpler Problem: Perhaps we can correct or remove the trend to simplify modeling and improve model performance.\n* More Data: Perhaps we can use trend information, directly or as a summary, to provide additional information to the model and improve model performance."},{"metadata":{},"cell_type":"markdown","source":"**Types of Trends\nThere are all kinds of trends.**\n\nTwo general classes that we may think about are:\n\n* Deterministic Trends: These are trends that consistently increase or decrease.\n* Stochastic Trends: These are trends that increase and decrease inconsistently.\n\nIn general, deterministic trends are easier to identify and remove, but the methods discussed in this tutorial can still be useful for stochastic trends.\n\nWe can think about trends in terms of their scope of observations.\n\n* Global Trends: These are trends that apply to the whole time series.\n* Local Trends: These are trends that apply to parts or subsequences of a time series.\n\nGenerally, global trends are easier to identify and address."},{"metadata":{"_uuid":"d629ff2d2480ee46fbb7e2d37f6b5fab8052498a","_cell_guid":"79c7e3d0-c299-4dcb-8224-4455121ee9b0","trusted":true},"cell_type":"code","source":"file_path ='/kaggle/input/shampoo/shampoo.csv'","execution_count":3,"outputs":[]},{"metadata":{"trusted":true},"cell_type":"code","source":"from pandas import read_csv\nfrom pandas import datetime\nfrom matplotlib import pyplot\n \ndef parser(x):\n    return datetime.strptime('190'+x, '%Y-%m')\n \nseries = read_csv(file_path, header=0, parse_dates=[0], index_col=0, squeeze=True, date_parser=parser)\nseries.plot()\npyplot.show()","execution_count":5,"outputs":[{"output_type":"stream","text":"/opt/conda/lib/python3.7/site-packages/ipykernel_launcher.py:2: FutureWarning: The pandas.datetime class is deprecated and will be removed from pandas in a future version. Import from datetime module instead.\n  \n","name":"stderr"},{"output_type":"display_data","data":{"text/plain":"<Figure size 432x288 with 1 Axes>","image/png":"\n"},"metadata":{"needs_background":"light"}}]},{"metadata":{},"cell_type":"markdown","source":"**Detrend by Differencing**\n\nvalue(t) = observation(t) - observation(t-1)\n\nThis has the effect of removing a trend from a time series dataset.\n\nThis approach works well for data with a linear trend. If the trend is quadratic (the change in the trend also increases or decreases), then a difference of the already-differenced dataset can be taken, a second level of differencing. This process can be further repeated if needed."},{"metadata":{"trusted":true},"cell_type":"code","source":"from pandas import read_csv\nfrom pandas import datetime\nfrom matplotlib import pyplot\n \ndef parser(x):\n    return datetime.strptime('190'+x, '%Y-%m')\n \nseries = read_csv(file_path, header=0, parse_dates=[0], index_col=0, squeeze=True, date_parser=parser)\nX = series.values\ndiff = list()\nfor i in range(1, len(X)):\n    value = X[i] - X[i - 1]\n    diff.append(value)\npyplot.plot(diff)\npyplot.show()","execution_count":6,"outputs":[{"output_type":"stream","text":"/opt/conda/lib/python3.7/site-packages/ipykernel_launcher.py:2: FutureWarning: The pandas.datetime class is deprecated and will be removed from pandas in a future version. Import from datetime module instead.\n  \n","name":"stderr"},{"output_type":"display_data","data":{"text/plain":"<Figure size 432x288 with 1 Axes>","image/png":"\n"},"metadata":{"needs_background":"light"}}]},{"metadata":{},"cell_type":"markdown","source":"**Detrend by Model Fitting**\n\nLinear trends can be summarized by a linear model, and nonlinear trends may be best summarized using a polynomial or other curve-fitting method.\n\nvalue(t) = observation(t) - prediction(t)\n\nThe predictions from this model will form a straight line that can be taken as the trend line for the dataset. These predictions can also be subtracted from the original time series to provide a detrended version of the dataset.\n\n\nThe residuals from the fit of the model are a detrended form of the dataset. Polynomial curve fitting and other nonlinear models can also be used.\n\nWe can implement this in Python by training a scikit-learn LinearRegression model on the data."},{"metadata":{"trusted":true},"cell_type":"code","source":"from pandas import read_csv\nfrom pandas import datetime\nfrom sklearn.linear_model import LinearRegression\nfrom matplotlib import pyplot\nimport numpy\n\ndef parser(x):\n    return datetime.strptime('190'+x, '%Y-%m')\n\nseries = read_csv(file_path, header=0, parse_dates=[0], index_col=0, squeeze=True, date_parser=parser)\n# fit linear model\nX = [i for i in range(0, len(series))]\nX = numpy.reshape(X, (len(X), 1))\ny = series.values\nmodel = LinearRegression()\nmodel.fit(X, y)\n# calculate trend\ntrend = model.predict(X)\n# plot trend\npyplot.plot(y)\npyplot.plot(trend)\npyplot.show()\n# detrend\ndetrended = [y[i]-trend[i] for i in range(0, len(series))]\n# plot detrended\npyplot.plot(detrended)\npyplot.show()","execution_count":7,"outputs":[{"output_type":"stream","text":"/opt/conda/lib/python3.7/site-packages/ipykernel_launcher.py:2: FutureWarning: The pandas.datetime class is deprecated and will be removed from pandas in a future version. Import from datetime module instead.\n  \n","name":"stderr"},{"output_type":"display_data","data":{"text/plain":"<Figure size 432x288 with 1 Axes>","image/png":"\n"},"metadata":{"needs_background":"light"}},{"output_type":"display_data","data":{"text/plain":"<Figure size 432x288 with 1 Axes>","image/png":"\n"},"metadata":{"needs_background":"light"}}]},{"metadata":{"trusted":true},"cell_type":"code","source":"","execution_count":null,"outputs":[]}],"metadata":{"kernelspec":{"name":"python3","display_name":"Python 3","language":"python"},"language_info":{"name":"python","version":"3.7.6","mimetype":"text/x-python","codemirror_mode":{"name":"ipython","version":3},"pygments_lexer":"ipython3","nbconvert_exporter":"python","file_extension":".py"}},"nbformat":4,"nbformat_minor":4}